import React from 'react';

export default function Channel({ channel, channelSelect }) {
    function channelClick(id) {
        channelSelect(id)
    }
    return (
        <div className="div__channel" onClick={() => {channelClick(channel.id)}}>
            {channel.channelName}
        </div>
    )
}
